	(104, 5, 2, 'OMA Treadmill for Home', 500, 'OMA 1012EB Treadmill, with a powerful 2.25HP ultra-quiet motor, is rated for users up to 300 LB while a durable heavy steel frame supports comfortable workouts. It also features a LED display that easily tracks your speed, time, distance, pulse, and calories. Besides, the spacious running area and shock-absorbing running belt accommodate users of many sizes and soften the impact on your joints.', '1645955641_81WabcOkpcL._AC_SL1500_.jpg', 'Treadmill'),
