	(119, 2, 3, 'Oversized Crop Blackout', 39.95, 'Carefully constructed with an incredibly soft cotton blend brushed fleece and an oversized relaxed fit, featuring drop shoulders.', '1646035302_oversized-crop-hoodie-blackout.jpg', 'Top'),
	(120, 2, 3, 'Oversized Crop Pink', 39.95, 'Carefully constructed with an incredibly soft cotton blend brushed fleece and an oversized relaxed fit, featuring drop shoulders.', '1646035355_oversized-crop-hoodie-dark-washed-pink.jpg', 'Top'),
	(121, 3, 4, 'Tight Shorts', 35, 'When you are intensely focusing on every minuscule movement, you need your clothing to help you, not hinder you. The 315 1/2 Tight Shorts know the importance of support in the moments that matter. Get locked in with an internal drawcord waistband, embrace full range of movement with full stretch seamless fabrics and nail the finish with knurling inspired detailing.', '1646039271_315SEAMLESSSHORTA1A4K-GBBC-M-AF1CHARCOALGREY42.A_GB_EDIT_ZH_cd8fe310-90b1-4c02-93b4-6c60fb2ff561_885x.jpg', 'Pants'),
	(122, 3, 4, 'Shorts', 30, 'Break time, done right. These Shorts make sure that even on your rest day it is obvious that you never skip leg day. Elevated with contrast piping, these shorts can be paired with anything, perfect for every day.', '1646041128_Recess3QuadShortBlack-WhiteA1A6X-A1A6X-BBGR.A-Edit_BK_885x.jpg', 'Pants'),
	(123, 3, 4, 'Basketball Shorts', 40, 'A regular fit, drawcord waist, open pockets and contrast piping give your rest day look the same energy you bring to your workouts.', '1646041180_RecessBasketballShortBlack-WhiteA1A5I_A1A5I-BBGR.A-Edit_AS_885x.jpg', 'Pants'),
	(124, 3, 4, 'Joggers', 45, 'The Joggers are created for preparation and recovery, with a slim fit, open pockets, and a drawcord waist.', '1646041295_RECESSPANT-BLACK37.B-Edit2HK_ZH_885x.jpg', 'Pants'),
	(125, 3, 4, 'Woven Joggers', 75, 'Woven Pants give you the freedom to create without limits. The lightweight woven fabric and sophisticated design details provide the premium feel, while the secure pockets and internal drawcord bring the premium functionality.', '1646041521_RetakeWovenPantBlackA1A4B.A-Edit_BK_c0f5cfb1-7c29-4648-bf65-aff77b90615b_885x.jpg', 'Pants'),
	(126, 3, 4, 'Grey Woven Joggers', 75, 'Woven Pants give you the freedom to create without limits. The lightweight woven fabric and sophisticated design details provide the premium feel, while the secure pockets and internal drawcord bring the premium functionality.', '1646041607_RetakeWovenPantCharcoalGreyA1A4B.A-Edit_BK_d0e25013-a5f3-4652-9eff-88066305f9a0_885x.jpg', 'Pants'),
	(127, 3, 4, 'Speed Joggers', 55, 'Make every mile count in the Speed Joggers. This streamlined fit is designed with heat and sweat-mapping ventilation, so you can stay cool and comfortable throughout.', '1646041947_SpeedPantBlackA1A1C-BBBB.A_ZH_ZH_885x.jpg', 'Pants'),
	(128, 3, 4, 'Restore Joggers', 50, 'They feature a drawcord waist, open pockets and a long ribbed cuff you can wear as is or fold it up.', '1646042167_RESTOREJOGGERBLACK.A-Edit_ZH_ZH_3142aa0f-75b8-4e0b-968b-aca87ac7f1df_885x.jpg', 'Pants'),
	(129, 3, 4, 'Long Sleeve T-Shirt', 26, 'Designed with fundamental performance features, including sweat-wicking capabilities and lightweight material, to help you realise and redefine your potential.', '1646047297_ArrivalSlimLST-ShirtSmokeyGreyA2A1H-GB69.A-Edit_Edit_HK_885x.jpg', 'Top'),
	(130, 3, 4, 'Retake Crew', 75, 'We evolve. We grow. We move. And the Retake Crew is by your side every step of the way. ', '1646047838_RetakeCrewWildcardBlackA1A6L.A-Edit_BK_799bde58-8cdc-4419-b2f4-9419899f6b48_885x.jpg', 'Top'),
