	(105, 5, 2, 'Adjustable Bench', 134, 'Adjustable Bench,Utility Weight Bench for Full Body Workout- Multi-Purpose Foldable incline/decline Bench ', '1645955738_513PamT-XPL._AC_SL1500_.jpg', 'Bench'),
