	(119, 2, 3, 'Oversized Crop Blackout', 39.95, 'Carefully constructed with an incredibly soft cotton blend brushed fleece and an oversized relaxed fit, featuring drop shoulders.', '1646035302_oversized-crop-hoodie-blackout.jpg', 'Top'),
	(120, 2, 3, 'Oversized Crop Pink', 39.95, 'Carefully constructed with an incredibly soft cotton blend brushed fleece and an oversized relaxed fit, featuring drop shoulders.', '1646035355_oversized-crop-hoodie-dark-washed-pink.jpg', 'Top'),
	(121, 3, 4, 'Tight Shorts', 35, 'When you are intensely focusing on every minuscule movement, you need your clothing to help you, not hinder you. The 315 1/2 Tight Shorts know the importance of support in the moments that matter. Get locked in with an internal drawcord waistband, embrace full range of movement with full stretch seamless fabrics and nail the finish with knurling inspired detailing.', '1646039271_315SEAMLESSSHORTA1A4K-GBBC-M-AF1CHARCOALGREY42.A_GB_EDIT_ZH_cd8fe310-90b1-4c02-93b4-6c60fb2ff561_885x.jpg', 'Pants'),
	(122, 3, 4, 'Shorts', 30, 'Break time, done right. These Shorts make sure that even on your rest day it is obvious that you never skip leg day. Elevated with contrast piping, these shorts can be paired with anything, perfect for every day.', '1646041128_Recess3QuadShortBlack-WhiteA1A6X-A1A6X-BBGR.A-Edit_BK_885x.jpg', 'Pants'),
