	(126, 3, 4, 'Grey Woven Joggers', 75, 'Woven Pants give you the freedom to create without limits. The lightweight woven fabric and sophisticated design details provide the premium feel, while the secure pockets and internal drawcord bring the premium functionality.', '1646041607_RetakeWovenPantCharcoalGreyA1A4B.A-Edit_BK_d0e25013-a5f3-4652-9eff-88066305f9a0_885x.jpg', 'Pants'),
	(127, 3, 4, 'Speed Joggers', 55, 'Make every mile count in the Speed Joggers. This streamlined fit is designed with heat and sweat-mapping ventilation, so you can stay cool and comfortable throughout.', '1646041947_SpeedPantBlackA1A1C-BBBB.A_ZH_ZH_885x.jpg', 'Pants'),
	(128, 3, 4, 'Restore Joggers', 50, 'They feature a drawcord waist, open pockets and a long ribbed cuff you can wear as is or fold it up.', '1646042167_RESTOREJOGGERBLACK.A-Edit_ZH_ZH_3142aa0f-75b8-4e0b-968b-aca87ac7f1df_885x.jpg', 'Pants'),
	(129, 3, 4, 'Long Sleeve T-Shirt', 26, 'Designed with fundamental performance features, including sweat-wicking capabilities and lightweight material, to help you realise and redefine your potential.', '1646047297_ArrivalSlimLST-ShirtSmokeyGreyA2A1H-GB69.A-Edit_Edit_HK_885x.jpg', 'Top'),
	(130, 3, 4, 'Retake Crew', 75, 'We evolve. We grow. We move. And the Retake Crew is by your side every step of the way. ', '1646047838_RetakeCrewWildcardBlackA1A6L.A-Edit_BK_799bde58-8cdc-4419-b2f4-9419899f6b48_885x.jpg', 'Top'),
	(131, 3, 4, 'Bold Hoodie Black', 50, 'The Bold Hoodie is never one to shy away. Turn heads when you train in the (fittingly) bold design of this gym hoodie. Its comfortable fit and lightweight construction make it ready for out-and-out lifting, over-and-over again.', '1646048233_BoldHoodieBlackA1A5L.A-Edit_GB_BK_96884d9f-3fec-4373-b6c1-875ab490b7b7_885x.jpg', 'Hoodie '),
	(132, 3, 4, 'Bold Hoodie Grey', 50, 'The Bold Hoodie is never one to shy away. Turn heads when you train in the (fittingly) bold design of this gym hoodie. Its comfortable fit and lightweight construction make it ready for out-and-out lifting, over-and-over again.', '1646048267_BoldHoodieOnyxGreyA1A5LA1A5L-GBCY.A-Edit_885x.jpg', 'Hoodie'),
	(133, 3, 4, 'Recess Hoodie', 45, 'The Recess Hoodie is made for the times when you are resting. This hoodie makes sure you are comfy doing what you enjoy with a drawcord hood, ribbed hem and cuffs, and a kangaroo pocket to the front, as well as stylish contrast piped details.', '1646048509_RecessPoHoodieCherryBrown-WhiteA1A3MA1A3M-NBDW.A-Edit_BK_885x.jpg', 'Hoodie'),
	(134, 3, 4, 'Recess T-shirt Brown', 25, 'Bring the same energy to your time out as you do your workout with the Recess T-Shirt. This cotton tee with short sleeves and contrast stitching details will take your prep and recovery game up a level.', '1646049011_RecessSsTeeCherryBrown-WhiteA1A5KA1A5K-NBDW.A-Edit_BK_885x.jpg', 'Top'),
	(135, 3, 4, 'Recess T-shirt Red', 25, 'Bring the same energy to your time out as you do your workout with the Recess T-Shirt. This cotton tee with short sleeves and contrast stitching details will take your prep and recovery game up a level.', '1646049068_CrestSsT-ShirtBurgundyRedA1A3J-RBBD.A_ZH_ZH_885x.jpg', 'Top'),
	(136, 3, 4, 'Recess T-shirt Black', 25, 'Bring the same energy to your time out as you do your workout with the Recess T-Shirt. This cotton tee with short sleeves and contrast stitching details will take your prep and recovery game up a level.', '1646049087_StudioT-ShirtBlackA1A6A.ATIFF_IS_851ed074-126c-4116-a916-f8f09b22eba1_885x.jpg', 'Top'),
	(137, 3, 4, 'Studio Jacket', 55, 'If you need to layer up on your commute, then the Studio Jacket can be trusted to be there for you all the way. Underarm perforations give you breathability, while the double zip brings versatility so you can wear the jacket open but still connected. ', 'Studio Jacket.jpg', 'Jacket'),
	(138, 4, 5, 'Adidas Wrestling Shoes', 79.95, 'Move with lightning quickness on the mat with these wrestling shoes.', '1646053456_ADI11803_1000_1.jpg', 'Shoes'),
