	(141, 4, 5, 'Weightlifting Shoes Black', 150, 'The FASTLIFT 360 is the latest edition to our lifting category. Boasting a brand new, highly durable upper design and an ultra-supportive lifting base, the new FASTLIFT 360 gives you the perfect balance of stability, protection and free movement. Weighing only 360g, it is the ideal lifter for beginners and seasoned athletes alike. Lock it down and take control.', '1646053952_INO1382_1000_2.jpg', 'Shoes');
